    return(
        <div className='flex items-center gap-x-24'>
        <div className='flex-grow flex-shrink-1'>
          <label className='text-3xl text-white font-bold'>
            {props.label}
          </label>
        </div>
        <input
          className='bg-slate-200 rounded-xl w-[350px] p-2 mr-4' // Opcional: ajuste a margem direita
          id='nome_fornecedor'
        />
      </div>
      
    );   
};

